function plot(data) {
  document.body.innerHTML = '';
  for(var i in data) {
    if(data.hasOwnProperty(i)) {
      var bar = document.createElement('div');
      bar.style.background = 'red';
      bar.style.margin='10px';
      bar.style.height = '40px';
      bar.style.width = data[i] + '%';
      document.body.appendChild(bar);
    }
  }
};
